import { makeStyles } from "@material-ui/core/styles";

export default makeStyles((theme) => ({
  container: {
    display: "flex",
    alignItems: "center",
    maxWidth: "1000px",
    margin: "auto",
    width: "100%",
    padding: "0 25px",
    textDecoration: "none",
    color: "#111",
  },
}));
